column68:
On pourrait améliorer la découvrabilité des services annexes : le service de géolocalisation de data.gouv, le service de recherche des unités légales et de leurs établissements d'entreprise.data.gouv.fr;

Intégrer schema.data.gouv.fr : voir qu'un jeu de données correspond à un schéma, rechercher tous les jeux de données qui respectent un schéma, etc, identifier les jeux de données qui suivent un schéma de tranport ou d'adresse, etc;

Simplifier l'interface, notamment la dualité entre l'interface d'admin et l'interface utilisateur

Editorialiser le moteur de recherche ou faire des pages thématiques maintenues.

Favoriser l'embed de datagouv sur d'autres sites, plutôt que de multiplier les portails open data dans tous les sens et dans tous les organismes publiques.

Détecter les identifiants des datasets, mettre un lien vers la donnée de référence qui correspond.
